  `p` varchar(100) DEFAULT NULL,
  `q` text,
  `g` text,
  `a` text,
  `b` text,
  `file1` longblob,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=latin1;

